-- ----------------------------
-- Procedure structure for "BDFYRED"
-- ----------------------------
CREATE OR REPLACE PROCEDURE "BDFYRED" is
begin
declare cursor ordersCursor is 
select orden.ordenid,orden.syscode, cursor(select '',orden.fabriccode,sum(o.amount),dict.ecode from ordendetail o left join dict 
on (o.singleclothingid=dict.id) where o.ordeniD=orden.ordeniD group by orden.fabriccode,dict.ecode)  from orden where orden.syscode='CX1206180030' ;
rsCursor SYS_REFCURSOR;
ordersId varchar2(50);
orders_no varchar2(50);
model1 varchar2(50);
fabrics varchar2(50);
REDQuantity varchar2(50);
FYQuantity varchar2(50);
countModel number;
countFabrics number;
categories varchar2(50);
kcczrq varchar2(50);
states number;
begin
  OPEN ordersCursor;
  LOOP
  fetch ordersCursor into ordersId,orders_no,rsCursor;
  exit when ordersCursor%NOTFOUND;
    states :=0;
    LOOP
    fetch rsCursor into model1,fabrics,REDQuantity,categories;
    exit when rsCursor%NOTFOUND;
    select count(*) into countFabrics from xtm22@myfyerp.regress.rdbms.dev.us.oracle.com where xtwpdm = fabrics;
    select count(*) into countModel from xtm32@myfyerp.regress.rdbms.dev.us.oracle.com where xtwpdm = model1;
    if countFabrics = 0 then
       fabrics := 'MDT0000';
    end if;
    if countModel=0 then
       model1 := 'K'||categories||'0000';
    end if;
    select sum(kcdwsl),max(to_char(kcczrq,'yyyy-mm-dd')) into FYQuantity,kcczrq from kct03@myfyerp.regress.rdbms.dev.us.oracle.com where xtwpdm like model1||fabrics||'%' and kcczlx='02' and scggdh=orders_no;
    if FYQuantity is null then
       FYQuantity := '0';
    end if;
    if REDQuantity is null then
       REDQuantity:='0';
    end if;
    if to_number(REDQuantity) > to_number(FYQuantity) then
       states := 1;
    end if;
    end loop;
    close rsCursor;
    if states=0 then
       update orden set orden.statusid = '10032' where ordenID=ordersId;
       commit;
    end if;
  end loop;
  close ordersCursor;
end;
end BDFYRED;
/

